import React, { Component } from 'react';
export default class News extends Component {
    render() {
        var json = this.props.articles
        var arr = [];
        Object.keys(json).forEach(function(key) {
          arr.push(json[key]);
        });
        const listItems = arr[2].map((link) =>
        <div>
            <a  data-toggle="collapse" href="#collapseExample" role="button" aria-expanded="false" aria-controls="collapseExample"><li key={link.title} className='list-group-item'>{link.title}</li></a>
            <div className="collapse" id="collapseExample">
                <div className="card card-body" key={link.description}>
                    {link.description}
                </div>
            </div> 
            <br></br>
        </div>
    );
        return (
            <div>
                <ul className='list-group'>
                    {listItems}
                </ul>
            </div>
        )
    }
}
